import React, {Component} from 'react';
import PostData from '../../services/data.json';



 class Lista extends Component{

    render(){
        return(
            <div>
                <h1>hello There</h1>
                {PostData.map((postData, index)=>{
                    <h1>{postData.name}</h1>
                })}
            </div>
        );
    }
}

export default Lista;
